import React from 'react';
import RemoteMypage from '../images/remote-mypage.png';
import RemoteLogout from '../images/remote-logout.png';
import RemoteIntro from '../images/remote-intro.png';
import RemoteMak from '../images/remote-mak.png';
import RemoteBrew from '../images/remote-brew.png';

const Nav = () => {
  const remoteMypage = RemoteMypage;

  return (
    <div>
      마이페이지
      <img src={remoteMypage} alt="mypage" />
    </div>
  );
};

export default Nav;
